(1, 'aboutus', 'About News Portal', '<h1 style=\"margin: 20px 0px 10px; font-size: 18px; font-weight: bold; line-height: 1.1; color: rgb(119, 119, 119); font-family: &quot;Merriweather Sans&quot;, Arial, Helvetica, sans-serif !important;\">About us</h1><div class=\"row\" style=\"color: rgb(119, 119, 119); font-family: &quot;Noto Sans Tamil&quot;, sans-serif;\"><div class=\"col-md-12\" style=\"float: left; width: 975px;\"><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; font-size: 13px; color: rgb(0, 0, 0); line-height: 20px; font-family: &quot;Merriweather Sans&quot;, Arial, Helvetica, sans-serif !important;\">Seithipunal is a Product of SGS Creative Media. Seithipunal is a digital Tamil news publication, founded in July 2016 with a goal to educate and inform people about the latest happenings in the world about TECHNOLOGY, POLITICS, TAMILNADU, INDIA, WORLD, VIDEO, CINEMA, MEDICAL, SPORTS AND LIFE STYLE and much more.</p></div></div><div class=\"row\" style=\"color: rgb(119, 119, 119); font-family: &quot;Noto Sans Tamil&quot;, sans-serif;\"><div class=\"col-md-12\" style=\"float: left; width: 975px;\"><h2 style=\"font-weight: bold; line-height: 1.1; margin-top: 20px; margin-bottom: 10px; font-size: 18px; font-family: &quot;Merriweather Sans&quot;, Arial, Helvetica, sans-serif !important;\">Goal</h2><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; font-size: 13px; color: rgb(0, 0, 0); line-height: 20px; font-family: &quot;Merriweather Sans&quot;, Arial, Helvetica, sans-serif !important;\">Our goal is to publish reliable news Special articles; interview and other bits of information that could help people understand news in a better way. One of the fastest growing with mobile / you tube /web based news with quality content, Video, Interview &amp; etc.</p></div></div><div class=\"row\" style=\"color: rgb(119, 119, 119); font-family: &quot;Noto Sans Tamil&quot;, sans-serif;\"><div class=\"col-md-12\" style=\"float: left; width: 975px;\"><h2 style=\"font-weight: bold; line-height: 1.1; margin-top: 20px; margin-bottom: 10px; font-size: 18px; font-family: &quot;Merriweather Sans&quot;, Arial, Helvetica, sans-serif !important;\">Vision</h2><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; font-size: 13px; color: rgb(0, 0, 0); line-height: 20px; font-family: &quot;Merriweather Sans&quot;, Arial, Helvetica, sans-serif !important;\">Our vision to make digital content easily available, By digital we have started with News, we have plans to touch base various segments like videos, Technology, Movie Site where the common people have day to day needs. Our editorial vision is to deliver hard news - not speculation and rumors.</p></div></div><div class=\"row\" style=\"color: rgb(119, 119, 119); font-family: &quot;Noto Sans Tamil&quot;, sans-serif;\"><div class=\"col-md-12\" style=\"float: left; width: 975px;\"><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; font-size: 13px; color: rgb(0, 0, 0); line-height: 20px; font-family: &quot;Merriweather Sans&quot;, Arial, Helvetica, sans-serif !important;\">Forming of Seithipunal website serves to fill in the void with the lack of reliable Tamil news websites. Our to-the-point news items are delivered professionally in an Associated Press-style for quick review and analysis.</p><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; font-size: 13px; color: rgb(0, 0, 0); line-height: 20px; font-family: &quot;Merriweather Sans&quot;, Arial, Helvetica, sans-serif !important;\">As previously noted, our editorial vision is to deliver hard news — not speculation and rumors. We are not experts, nor do we claim to be. We will, at times, make mistakes and we appreciate any corrections or general feedback.</p><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; font-size: 13px; color: rgb(0, 0, 0); line-height: 20px; font-family: &quot;Merriweather Sans&quot;, Arial, Helvetica, sans-serif !important;\">If there is anything we can help you out with, or if there is anything you would like us to cover, don’t hesitate to get in touch to our contact us page.</p></div></div>', '2024-12-22 11:40:01', '2024-12-22 11:43:33'),
(2, 'contactus', 'Contact Details', '<p><br></p><p><b>Address :&nbsp;</b></p><p><b>Phone Number : </b>+91 -7904269112</p><p><b>Email -id : </b>seithipunaltamil@gmail.com</p>', '2024-12-22 11:40:21', '2024-12-22 11:53:12'),
