eather Sans&quot;, Arial, Helvetica, sans-serif !important;\">Seithipunal owns, solely and exclusively, all rights, title and interest in and to the Web Site, all the content, code, data and materials including multi-media content, the look and feel, design and organization of the Web Site, and the compilation of the content, code, data and materials on the Web Site. Your access and use of the Web Site does not grant to you ownership of any content, code, data or materials.</p></div></div><div class=\"row\" style=\"color: rgb(119, 119, 119); font-family: &quot;Noto Sans Tamil&quot;, sans-serif;\"><div class=\"col-md-12\" style=\"float: left; width: 975px;\"><h2 style=\"font-weight: bold; line-height: 1.1; margin-top: 20px; margin-bottom: 10px; font-size: 18px; font-family: &quot;Merriweather Sans&quot;, Arial, Helvetica, sans-serif !important;\">Website usage</h2><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; font-size: 13px; color: rgb(0, 0, 0); line-height: 20px; font-family: &quot;Merriweather Sans&quot;, Arial, Helvetica, sans-serif !important;\">The website user confirms that he/she is above 18 years old and legally bound for the actions taken by him/her. The user further agrees that only valid information and credentials are provided by them as and when required for the site usage.</p><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; font-size: 13px; color: rgb(0, 0, 0); line-height: 20px; font-family: &quot;Merriweather Sans&quot;, Arial, Helvetica, sans-serif !important;\">The information provided in the website Seithipunal.com, articles, magazines and other information sent to you may be copy right protected with appropriate intellectual rights with due owners. No part of that information should be reproduced, copied, adapted or published in some other format. Where ever due usage of the same is required, the user can get permission from Seithipunal.com before using it. Seithipunal reserves the right in this matter.</