-size: 18px; font-family: &quot;Merriweather Sans&quot;, Arial, Helvetica, sans-serif !important;\">Third party content</h2><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; font-size: 13px; color: rgb(0, 0, 0); line-height: 20px; font-family: &quot;Merriweather Sans&quot;, Arial, Helvetica, sans-serif !important;\">Sometimes you may find that the information is provided by third parties directly to the user through Seithipunal.com. These may be in the form of information content, sponsored material, advertising content etc., You are responsible for any actions taken on those kind of material and you indemnify Seithipunal.com on all the actions taken on those information.</p></div></div><div class=\"row\" style=\"color: rgb(119, 119, 119); font-family: &quot;Noto Sans Tamil&quot;, sans-serif;\"><div class=\"col-md-12\" style=\"float: left; width: 975px;\"><h2 style=\"font-weight: bold; line-height: 1.1; margin-top: 20px; margin-bottom: 10px; font-size: 18px; font-family: &quot;Merriweather Sans&quot;, Arial, Helvetica, sans-serif !important;\">Interaction with the site</h2><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; font-size: 13px; color: rgb(0, 0, 0); line-height: 20px; font-family: &quot;Merriweather Sans&quot;, Arial, Helvetica, sans-serif !important;\">Seithipunal.com provides the facility getting user inputs by way of comments, posts and other user inputs. Users are advised to use this in a proper manner considering the overall benefits to the site users. And strictly avoid posting any defamatory, infringing, obscene, indecent or unlawful material or information, or any other software related material that can cause damage to the site.</p><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; font-size: 13px; color: rgb(0, 0, 0); line-height: 20px; font-family: &quot;Merriweather Sans&quot;, Arial, Helvetica, sans-serif !important;\">Seithipunal.com reserves the right to remove any messages that deem to be inappropriate, not to the context of subject matter discussed/covered, racist, sexist or threatening. Messages using inappropriate language can also be removed.</p><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; font-size: 13px; color: rgb(0, 0, 0); line-height: 20px; font-family: &quot;Merriweather Sans&quot;, Arial, Helvetica, sans-serif !important;\">It is important to remember that comments submitted to the Web site may be recorded and stored in multiple places, both on our Web site and elsewhere on the Internet including social media sites, which are likely to be accessible by an extended audience.</p></div></div><div class=\"row\" style=\"color: rgb(119, 119, 119); font-family: &quot;Noto Sans Tamil&quot;, sans-serif;\"><div class=\"col-md-12\" style=\"float: left; width: 975px;\"><h2 style=\"font-weight: bold; line-height: 1.1; margin-top: 20px; margin-bottom: 10px; font-size: 18px; font-family: &quot;Merriweather Sans&quot;, Arial, Helvetica, sans-serif !important;\">Indian Law</h2><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; font-size: 13px; color: rgb(0, 0, 0); line-height: 20px; font-family: &quot;Merriweather Sans&quot;, Arial, Helvetica, sans-serif !important;\">The Terms and Conditions agreement is governed by the Laws of India. The Courts of law at Chennai, India shall have exclusive jurisdiction over any disputes arising under this agreement.</p><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; font-size: 13px; color: rgb(0, 0, 0); line-height: 20px; font-family: &quot;Merriweather Sans&quot;, Arial, Helvetica, sans-serif !important;\">Seithipunal.com</p><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; font-size: 13px; color: rgb(0, 0, 0); line-height: 20px; font-family: &quot;Merriweather Sans&quot;, Arial, Helvetica, sans-serif !important;\"><span style=\"font-weight: 700;\">19th Dec 2017</span></p></div></div>', '2024-12-22 11:53:30', '2024-12-22 11:54:56'),
(4, 'privacy', 'Privacy Policy', '<h1 style=\"margin: 20px 0px 10px; font-size: 18px; font-weight: bold; line-height: 1.1; color: rgb(119, 119, 119); font-family: &quot;Merriweather Sans&quot;, Arial, Helvetica, sans-serif !important;\">Privacy and Policy</h1><h2 style=\"font-weight: bold; line-height: 1.1; margin-top: 20px; margin-bottom: 10px; font-size: 18px; font-family: &quot;Merriweather Sans&quot;, Arial, Helvetica, sans-serif !important;\">Seithipunal.com</h2><h1 style=\"margin: 20px 0px 10px; font-size: 18px; font-weight: bold; line-height: 1.1; color: rgb(119, 119, 119); font-family: &quot;Merriweather Sans&quot;, Arial, Helvetica, sans-serif !important;\"><div class=\"row\" style=\"font-family: &quot;Noto Sans Tamil&quot;, sans-serif; font-size: 14px; font-weight: 400;\"><div class=\"col-md-12\" style=\"float: left; width: 975px;\"></div></div><div class=\"row\" style=\"font-family: &quot;Noto Sans Tamil&quot;, sans-serif; font-size: 14px; font-weight: 400;\"><div class=\"col-md-12\" style=\"float: left; width: 975px;\"><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; font-size: 13px; color: rgb(0, 0, 0); line-height: 20px; font-family: &quot;Merriweather Sans&quot;, Arial, Helvetica, sans-serif !important;\">Seithipunal.com is committed to protecting your privacy. This Privacy Policy applies to those who visit our website, access our information resources and to those who use our services. From time to time this Privacy Policy can be amended and the amended policy will be posted here.</p></div></div></h1><h2 style=\"font-weight: bold; line-height: 1.1; margin-top: 20px; margin-bottom: 10px; font-size: 18px; font-family: &quot;Merriweather Sans&quot;, Arial, Helvetica, sans-serif !important;\">Information collection</h2><h1 style=\"margin: 20px 0px 10px; font-size: 18px; font-weight: bold; line-height: 1.1; color: rgb(119, 119, 119); font-family: &quot;Merriweather Sans&quot;, Arial, Helvetica, sans-serif !important;\"><div class=\"row\