nt;\">Information usage</h2><h1 style=\"margin: 20px 0px 10px; font-size: 18px; font-weight: bold; line-height: 1.1; color: rgb(119, 119, 119); font-family: &quot;Merriweather Sans&quot;, Arial, Helvetica, sans-serif !important;\"><div class=\"row\" style=\"font-family: &quot;Noto Sans Tamil&quot;, sans-serif; font-size: 14px; font-weight: 400;\"><div class=\"col-md-12\" style=\"float: left; width: 975px;\"><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; font-size: 13px; color: rgb(0, 0, 0); line-height: 20px; font-family: &quot;Merriweather Sans&quot;, Arial, Helvetica, sans-serif !important;\">When we present information to our advertisers to help them understand our audience and confirm the value of advertising on our website it is usually in the form of aggregated statistics on traffic to various pages within our site. When you visit, subscribe or use our website, we may contact you from time to time about updating of new content or for more information on products and services.</p><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; font-size: 13px; color: rgb(0, 0, 0); line-height: 20px; font-family: &quot;Merriweather Sans&quot;, Arial, Helvetica, sans-serif !important;\">We do not sell, trade or otherwise disclose the information collected by us in delivering the service.</p></div></div></h1><h2 style=\"font-weight: bold; line-height: 1.1; margin-top: 20px; margin-bottom: 10px; font-size: 18px; font-family: &quot;Merriweather Sans&quot;, Arial, Helvetica, sans-serif !important;\">Use of cookies</h2><h1 style=\"margin: 20px 0px 10px; font-size: 18px; font-weight: bold; line-height: 1.1; color: rgb(119, 119, 119); font-family: &quot;Merriweather Sans&quot;, Arial, Helvetica, sans-serif !important;\"><div class=\"row\" style=\"font-family: &quot;Noto Sans Tamil&quot;, sans-serif; font-size: 14px; font-weight: 400;\"><div class=\"col-md-12\" style=\"float: left; width: 975px;\"><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; font-size: 13px; color: rgb(0, 0, 0); line-height: 20px; font-family: &quot;Merriweather Sans&quot;, Arial, Helvetica, sans-serif !important;\">When you use our Service we may store some information on your computer. This information will be in the form of a “cookie” or similar file. Cookies are small pieces of information stored on your hard drive, not on the Seithipunal.com website.</p><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; font-size: 13px; color: rgb(0, 0, 0); line-height: 20px; font-family: &quot;Merriweather Sans&quot;, Arial, Helvetica, sans-serif !important;\">The cookies that we use are essential for the basic functionalities of the service.</p><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; font-size: 13px; color: rgb(0, 0, 0); line-height: 20px; font-family: &quot;Merriweather Sans&quot;, Arial, Helvetica, sans-serif !important;\">We do not use cookies to spy on you or otherwise invade your privacy. Also, we do not use cookies for any advertisement purpose.</p><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; font-size: 13px; color: rgb(0, 0, 0); line-height: 20px; font-family: &quot;Merriweather Sans&quot;, Arial, Helvetica, sans-serif !important;\">Seithipunal.com has no access to or control over these cookies that are used by third-party advertisers.</p><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; font-size: 13px; color: rgb(0, 0, 0); line-height: 20px; font-family: &quot;Merriweather Sans&quot;, Arial, Helvetica, sans-serif !important;\">For site visitor analytics, we use a third party service like Google Analytics and cookies are used for this purpose by those services. This may be for identifying and distinguishing the visitors and traffic information.</p></div></div></h1><h2 style=\"font-weight: bold; line-height: 1.1; margin-top: 20px; margin-bottom: 10px; font-size: 18px; font-family: &quot;Merriweather Sans&quot;, Arial, Helvetica, sans-serif !important;\">Links to other sites</h2><h1 style=\"margin: 20px 0px 10px; font-size: 18px; font-weight: bold; line-height: 1.1; color: rgb(119, 119, 119); font-family: &quot;Merriweather Sans&quot;, Arial, Helvetica, sans-serif !important;\"><div class=\"row\" style=\"font-family: &quot;Noto Sans Tamil&quot;, sans-serif; font-size: 14px; font-weight: 400;\"><div class=\"col-md-12\" style=\"float: left; width: 975px;\"><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; font-size: 13px; color: rgb(0, 0, 0); line-height: 20px; font-family: &quot;Merriweather Sans&quot;, Arial, Helvetica, sans-serif !important;\">Seithipunal.com site and its information contents may include links to other websites. Such sites are governed by their respective privacy policies, which are beyond our control. Once you leave our website (you can tell where you are by checking the URL in the location bar on your browser), use of any information you provide is governed by the privacy policy of the operator of the site you are visiting. That policy may differ from ours. If you can\'t find the privacy policy of any of these sites via a link from the site\'s homepage, you should contact the site directly for more information.</p></div></div></h1><h2 style=\"font-weight: bold; line-height: 1.1; margin-top: 20px; margin-bottom: 10px; font-size: 18px; font-family: &quot;Merriweather Sans&quot;, Arial, Helvetica, sans-serif !important;\">Security and Storage</h2><h1 style=\"margin: 20px 0px 10px; font-size: 18px; font-weight: bold; line-height: 1.1; color: rgb(119, 119, 119); font-family: &quot;Merriweather Sans&quot;, Arial, Helvetica, sans-serif !important;\"><div class=\"row\" style=\"font-family: &quot;Noto Sans Tamil&quot;, sans-serif; font-size: 14px; font-weight: 400;\"><div class=\"col-md-12\" style=\"float: left; width: 975px;\"><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; font-size: 13px; color: rgb(0, 0, 0); line-height: 20px; font-family: &quot;Merriweather Sans&quot;, Arial, Helvetica, sans-serif !important;\">The Seithipunal.com website has industry standard security measures in place to protect loss, misuse, and alteration of the information stored and processed it. Seithipunal.com cares about data security and takes all reasonable steps to ensure the safety of your information.</p><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; font-size: 13px; color: rgb(0, 0, 0); line-height: 20px; font-family: &quot;Merriweather Sans&quot;, Arial, Helvetica, sans-serif !important;\">We take appropriate security measures to protect against unauthorized access to or unauthorized alteration, disclosure or destruction of data. These include internal reviews of our data collection, storage and processing practices and security measures, including appropriate encryption and physical security measures to guard against unauthorized access to systems where we store personal data.</p></div></div></h1><h2 style=\"font-weight: bold; line-height: 1.1; margin-top: 20px; margin-bottom: 10px; font-size: 18px; font-family: &quot;Merriweather Sans&quot;, Arial, Helvetica, sans-serif !important;\">Contacting us:</h2><h1 style=\"margin: 20px 0px 10px; font-size: 18px; font-weight: bold; line-height: 1.1; color: rgb(119, 119, 119); font-family: &quot;Merriweather Sans&quot;, Arial, Helvetica, sans-serif !important;\"><div class=\"row\" style=\"font-family: &quot;Noto Sans Tamil&quot;, sans-serif; font-size: 14px; font-weight: 400;\"><div class=\"col-md-12\" style=\"float: left; width: 975px;\"><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; font-size: 13px; color: rgb(0, 0, 0); line-height: 20px; font-family: &quot;Merriweather Sans&quot;, Arial, Helvetica, sans-serif !important;\">By using the Seithipunal.com service, you consent to this Privacy Policy.</p><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; font-size: 13px; color: rgb(0, 0, 0); line-height: 20px; font-family: &quot;Merriweather Sans&quot;, Arial, Helvetica, sans-serif !important;\">If there are any questions about our Privacy Policy you may contact us.</p><br><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; font-size: 13px; color: rgb(0, 0, 0); line-height: 20px; font-family: &quot;Merriweather Sans&quot;, Arial, Helvetica, sans-serif !important;\"><span style=\"font-weight: 700;\">Date: 19th Dec 2017</span></p></div></div></h1>', '2024-12-22 11:53:35', '2024-12-23 16:17:33');

