(1, 'Israel attacks schools and hospitals in Gaza! Lives lost at the scene!', 'காசாவில் பள்ளிக்கூடம் மற்றும் மருத்துவமனைகள் மீது இஸ்ரேல் தாக்குதல்! சம்பவ இடத்திலே பறிபோன உயிர்கள்!', 'yes', 2, 1, 0, 'htag', 16, 'IsFlash,IsRecent', '<p><span style=\"color: rgb(31, 31, 31); font-family: monospace; font-size: 12px; white-space-collapse: preserve;\">பாலஸ்தின நகரமான காசாவில் இஸ்ரேல் ராணுவத்தின் தாக்குதல் 14 மாதங்களாக தொடர்வதைத் தொடர்ந்து, குண்டுகளால் நடந்த வெடிப்புகளில் பலியானோரின் எண்ணிக்கை 45,000 ஐ கடந்துள்ளது. 107,573 பேர் காயமடைந்துள்ளனர், இது மக்களை பெரும் பிரச்சினைகளில் சிக்க வைக்கின்றது.</span></p><p><span style=\"color: rgb(31, 31, 31); font-family: monospace; font-size: 12px; white-space-collapse: preserve;\">பாலஸ்தின நகரமான காசாவில் இஸ்ரேல் ராணுவத்தின் தாக்குதல் 14 மாதங்களாக தொடர்வதைத் தொடர்ந்து, குண்டுகளால் நடந்த வெடிப்புகளில் பலியானோரின் எண்ணிக்கை 45,000 ஐ கடந்துள்ளது. 107,573 பேர் காயமடைந்துள்ளனர், இது மக்களை பெரும் பிரச்சினைகளில் சிக்க வைக்கின்றது.</span></p><p><img src=\"data:image/png;base64,\" data-filename=\"Asset 1.png\" style=\"width: 1541px;\"><span style=\"color: rgb(31, 31, 31); font-family: monospace; font-size: 12px; white-space-collapse: preserve;\"><br></span></p>', '<p><span style=\"color: rgb(31, 31, 31); font-family: monospace; font-size: 12px; white-space-collapse: preserve;\">பாலஸ்தின நகரமான காசாவில் இஸ்ரேல் ராணுவத்தின் தாக்குதல் 14 மாதங்களாக தொடர்வதைத் தொடர்ந்து, குண்டுகளால் நடந்த வெடிப்புகளில் பலியானோரின் எண்ணிக்கை 45,000 ஐ கடந்துள்ளது. 107,573 பேர் காயமடைந்துள்ளனர், இது மக்களை பெரும் பிரச்சினைகளில் சிக்க வைக்கின்றது.</span></p>', '2024-12-22 14:00:57', '2024-12-23 15:11:47', 1, 0, '980586b9e4ec85ae5fa052a67deb2ec5.jpg', 'a285a5c56a2f80a5c296af7f0d1c36a3.mp4', 0, 'Jai', 'draft', 'Jai');

